import styled from "styled-components";

const Project = () => {
  return 
  <Wrap>
    <Top >
      <Title>Project</Title>
      <Line />
    </Top>
  </Wrap>
};

export default Project;

const Wrap = styled.main`
  width: 100%;
  height: 100vh;
  display: flex;
`;
